package io.github.sandeeplakka.codewars.kyu3;

import org.junit.jupiter.api.Test;

import java.math.BigInteger;

import static org.junit.jupiter.api.Assertions.assertEquals;

/*
The Millionth Fibonacci Kata

The year is 1214. One night, Pope Innocent III awakens to find the the archangel Gabriel floating before him.
Gabriel thunders to the pope:

    Gather all of the learned men in Pisa, especially Leonardo Fibonacci.
    In order for the crusades in the holy lands to be successful,
    these men must calculate the millionth number in Fibonacci's recurrence.
    Fail to do this, and your armies will never reclaim the holy land. It is His will.

The angel then vanishes in an explosion of white light.

Pope Innocent III sits in his bed in awe. How much is a million? he thinks to himself.
He never was very good at math.

He tries writing the number down,
but because everyone in Europe is still using Roman numerals at this moment in history,
he cannot represent this number. If he only knew about the invention of zero, it might make this sort of thing easier.

He decides to go back to bed. He consoles himself, The Lord would never challenge me thus;
this must have been some deceit by the devil. A pretty horrendous nightmare, to be sure.

Pope Innocent III's armies would go on to conquer Constantinople (now Istanbul),
but they would never reclaim the holy land as he desired.

In this kata you will have to calculate fib(n) where:

fib(0) := 0
fib(1) := 1
fin(n + 2) := fib(n + 1) + fib(n)

Write an algorithm that can handle n up to 2000000.

Your algorithm must output the exact integer answer, to full precision.
Also, it must correctly handle negative numbers as input.

HINT I:
Can you rearrange the equation fib(n + 2) = fib(n + 1) + fib(n)
to find fib(n) if you already know fib(n + 1) and fib(n + 2)?
Use this to reason what value fib has to have for negative values.

HINT II:
See https://mitpress.mit.edu/sites/default/files/sicp/full-text/book/book-Z-H-11.html#%_sec_1.2.4

Categories : Algorithms, Mathematics, Numbers
 */
public class Fibonacci {

    @Test
    public void testFib0() {
        testFib(0, 0);
    }

    @Test
    public void testFib1() {
        testFib(1, 1);
    }

    @Test
    public void testFib2() {
        testFib(1, 2);
    }

    @Test
    public void testFib3() {
        testFib(2, 3);
    }

    @Test
    public void testFib4() {
        testFib(3, 4);
    }

    @Test
    public void testFib5() {
        testFib(5, 5);
    }

    @Test
    public void testFib6() {
        //expected value is too big : pasted at the end of file, but the test here is get
        //this output within ~10ms
        testFib(-1, 1389408);
    }

    private static void testFib(long expected, long input) {
        BigInteger found;
        try {
            found = fib(BigInteger.valueOf(input));
        } catch (Throwable e) {
            // see https://github.com/Codewars/codewars.com/issues/21
            throw new AssertionError("exception during test: " + e, e);
        }
        assertEquals(BigInteger.valueOf(expected), found);
    }


    public static BigInteger fib(BigInteger n) {
        // ...
        if (n.compareTo(BigInteger.ZERO) == 0) return BigInteger.ZERO;
        if (n.compareTo(BigInteger.ONE) == 0) return BigInteger.ONE;

//        if (true)
//            return Stream.generate(FibonacciGenerator::next).limit(n.intValue() - 2).skip(n.longValueExact() - 3).findAny().get();

        BigInteger a = BigInteger.ZERO;
        BigInteger b = BigInteger.ONE;
        BigInteger sum = null;
        for (int i = 2; i <= n.intValue(); i++) {
            sum = a.add(b);
            a = b;
            b = sum;
        }

        return sum;
    }


    private static class FibonacciGenerator {
        private static BigInteger nMinusTwo = BigInteger.ONE;
        private static BigInteger nMinusOne = BigInteger.ZERO;

        public static BigInteger next() {
            final BigInteger n = nMinusTwo.add(nMinusOne);
            nMinusTwo = nMinusOne;
            nMinusOne = n;

            return n;
        }
    }

}


